import React, {Component} from 'react';
import './App.css';
import { Route, Switch } from 'react-router-dom';

import LoginPage from './Components/LoginPage/LoginPage';
import SignupPage from './Components/SignUpPage/SignupPage';
import AdminHome from './Components/AdminHome/AdminHome';
import UserHome from './Components/UserHome/UserHome';
import ImportData from './Components/ImportData/ImportData';
import ManageCompany from './Components/ManageCompany/ManageCompany';
import ManageExchange from './Components/ManageExchange/ManageExchange';
import ManageIPO from './Components/ManageIPO/ManageIPO';

class App extends Component {

    constructor(props){
        super(props);
        this.state = {
            authToken:"",
            userId:"",
            userName:""
        }
        this.setAuth = this.setAuth.bind(this);
        this.getAuthToken = this.getAuthToken.bind(this);
        this.getUserId = this.getUserId.bind(this);
        this.getUserName = this.getUserName.bind(this);
    }

    setAuth(authToken,userId,userName){
        console.log("New Auth set")
        this.setState(
          {
            authToken:authToken,
            userId:userId,
            userName:userName
          }
        )
      }

    getAuthToken(){
        return (this.state.authToken);
    }

    getUserId(){
        return (this.state.userId);
    }
    
    getUserName(){
        return (this.state.userName);
    }

    render() {
       return (
        <Switch>
            <Route exact path = "/" render={(props) => <LoginPage {...props} getAuthToken={this.getAuthToken} authFunction={this.setAuth} />}/>
            <Route path="/signup" render={(props) => <SignupPage {...props} />} />
            <Route path="/adminHome" render={(props) => <AdminHome getAuthToken={this.getAuthToken} {...props} />} />
            <Route path="/userHome" render={(props) => <UserHome {...props} />} />
            <Route path="/importData" render={(props) => <ImportData getAuthToken={this.getAuthToken} {...props} />} />
            <Route path="/manageCompany" render={(props) => <ManageCompany getAuthToken={this.getAuthToken} {...props} />} />
            <Route path="/manageExchange" render={(props) => <ManageExchange getAuthToken={this.getAuthToken} {...props} />} />
            <Route path="/manageIPO" render={(props) => <ManageIPO getAuthToken={this.getAuthToken} {...props} />} />
        </Switch>
       );
   } 
}

export default App;
